import axios from 'axios';

export const signup = (name, email, password) => {
  const url = 'http://localhost:3000/signup';
  return axios.post(url, {
    name: name,
    email: email,
    password: password
  })
  .then(function (response) {
    console.log(response);
  })
  .catch(function (error) {
    console.log(error);
  });
}
